import SideBarStyle from '../Style/SideBar.module.css'

const SideBar = () => {
    return (
        <div className={SideBarStyle.SideBarMain}>
            <button className='btn '></button>
            Cappuccino
Latte
Americano
Expresso
Flat White
            <button></button>
        </div>
    )
}
export default SideBar;
